import Categories from '../components/categories';
import Carousel from '../components/carousel';
import BrowseByCategory from '../components/browseByCategory';
import EnhanceYourMusicExperince from '../components/EnhanceYourMusicExperince';
import FlashSales from '../maincomponents/flashSales';
import styles from "../styles/home.module.css";

import browsecategory from "../svgs/categories.svg";
import rightArrow from "../svgs/righarrow.svg";
import leftArrow from "../svgs/leftarrow.svg";
import thismonth from "../svgs/thismonth.svg";
import Product from '../components/products';
const Home = () => {
    const categories = [
        { title: "Phones", image: "" },
        { title: "Computers", image: "" },
        { title: "SmartWatch", image: "" },
        { title: "Camera", image: "" },
        { title: "HeadPhones", image: "" },
        { title: "Gaming", image: "" },
    ]
    const products = [

        { title: "The north coat", price: 360, discount: 50, image: "", isDiscountDisplayed: false },
        { title: "Gucci duffle bag", price: 1160, discount: 20, image: "", isDiscountDisplayed: false },
        { title: "RGB liquid CPU Cooler", price: 170, discount: 10, image: "", isDiscountDisplayed: false },
        { title: "Small BookSelf", price: 360, discount: 30, image: "", isDiscountDisplayed: false },
    ]
    return (
        <>
            <div className={styles.container}>

                <div className={styles.bottomdivs}>
                    <div className={styles.categories}>
                        <Categories />
                    </div>
                    <div className={styles.carousel}>
                        <Carousel />
                    </div>
                </div>
                <div className={styles.part2}>
                    <FlashSales />
                    <div className={styles.viewProductButton}>
                        <button> View all products</button>

                    </div>

                </div>
                <div className={styles.part3}>
                    <div className={styles.header}>


                        <div className={styles.text}>
                            <div className={styles.titles}>
                                <div className={styles.today}>
                                    <img src={browsecategory} alt="Categories" />
                                </div>
                                <div className={styles.sales}>
                                    <h1>Browse By Category</h1>

                                </div>

                            </div>

                        </div>
                        <div className={styles.arrow}>
                            <img src={leftArrow} />
                            <img src={rightArrow} />


                        </div>
                    </div>
                    <div className={styles.browseByCategory}>
                        <BrowseByCategory categories={categories} />
                    </div>


                </div>
                <div className={styles.part4}>
                    <div className={styles.header}>



                        <div className={styles.titles}>
                            <div className={styles.today}>
                                <img src={thismonth} alt="This month" />
                            </div>
                            <div className={styles.sales}>
                                <h1>Best Selling Products</h1>

                            </div>


                        </div>
                        <div className={styles.view}>
                            <button> View All</button>
                        </div>


                    </div>
                    <div className={styles.bestsellingproduct}>
                        <Product products={products} />

                    </div>
                </div>
                <div className={styles.part5}>
                    <EnhanceYourMusicExperince/>
                    
                </div>

            </div>



        </>

    )

}
export default Home;